  const totalBits = entities.length * 7;
  const bufferSize = Math.ceil(totalBits / 8);
  const buffer = new ArrayBuffer(bufferSize);
  const dataView = new DataView(buffer);

  let offset = 0;
  for (const entity of entities) {
